function onYouTubeIframeAPIReady(){player1=new YT.Player("vid1",{events:{onReady:onPlayerReady}}),player1c=new YT.Player("vid1_clone",{events:{onReady:onPlayerReady}}),player2=new YT.Player("vid2",{events:{onReady:onPlayerReady}}),player3=new YT.Player("vid3",{events:{onReady:onPlayerReady}}),player4=new YT.Player("vid4",{events:{onReady:onPlayerReady}}),player5=new YT.Player("vid5",{events:{onReady:onPlayerReady}}),player5c=new YT.Player("vid5_clone",{events:{onReady:onPlayerReady}})}function onPlayerReady(e){e.target.mute(),muteSlider()}var player1,player1c,player2,player3,player4,player5,player5c,muteSlider=function(){$(".clone").find(".roundVideo").each(function(){{var e=$(this).find("iframe").attr("id");new YT.Player(e,{events:{onReady:onPlayerReady}})}})},muteAll=function(){player1.mute(),player2.mute(),player3.mute(),player4.mute(),player5.mute()};$(".mute").click(function(){var e=$(this).parent(".roundVideo").find("iframe").attr("id");switch($(this).toggleClass("unmuted"),e){case"vid1":player1.isMuted()?player1.unMute():player1.mute();break;case"vid1_clone":player1c.isMuted()?player1c.unMute():player1c.mute();break;case"vid2":player2.isMuted()?player2.unMute():player2.mute();break;case"vid3":player3.isMuted()?player3.unMute():player3.mute();break;case"vid4":player4.isMuted()?player4.unMute():player4.mute();break;case"vid5":player5.isMuted()?player5.unMute():player5.mute();break;case"vid5_clone":player5c.isMuted()?player5c.unMute():player5c.mute()}}),$(window).load(function(){muteAll(),muteSlider()});